"use client";
import { useEffect, useState } from "react";
import { useRouter } from "next/navigation";
import { useMovieContext } from "@/context/MovieContext";
import NavBar from "@/components/NavBar";
import SearchBar from "@/components/SearchBar";
import MovieList from "@/components/MovieList";

export default function HomePage() {
  const { user } = useMovieContext();
  const router = useRouter();
  const [movies, setMovies] = useState([]);
  const [filteredMovies, setFilteredMovies] = useState([]);

  useEffect(() => {
    if (!user) {
      router.push("/login");
    } else {
      loadMovies(); // Load movies when user is logged in
    }
  }, [user]);

  if (!user) return <p className="text-center mt-10">Redirecting to login...</p>;

  // âœ… Mock movie data (Replace this with an API call later)
  const loadMovies = () => {
    const mockMovies = [
      { id: 1, title: "Inception", year: "2010", image: "data:image/jpeg;base64," },
      { id: 2, title: "Interstellar", year: "2014", image: "data:image/jpeg;base64," },
      { id: 3, title: "The Dark Knight", year: "2008", image: "data:image/jpeg;base64," },
      { id: 4, title: "Parasite", year: "2019", image: "data:image/jpeg;base64," },
      { id: 5, title: "Avengers: Endgame", year: "2019", image: "data:image/jpeg;base64," },
    ];
    setMovies(mockMovies);
    setFilteredMovies(mockMovies); // Set filtered movies initially
  };

  // âœ… Handle search functionality
  const handleSearch = (query) => {
    const filtered = movies.filter((movie) =>
      movie.title.toLowerCase().includes(query.toLowerCase())
    );
    setFilteredMovies(filtered);
  };

  return (
    <div className="min-h-screen bg-gray-900 text-white">
      <NavBar />
      <div className="p-6">
        <h1 className="text-3xl font-bold mb-6 text-center">Movie Search</h1>
        <SearchBar onSearch={handleSearch} />
        <MovieList movies={filteredMovies} />
      </div>
    </div>
  );
}
